Defendant Kristine M Haveman in court with attorney Vincent Joseph Bobot.  Abbey Nickolie appeared for the State of Wisconsin. Defendant enters a no contest plea as to count 2 and count 3 is dismissed and read-in. Court imposed the following sentence:

  The defendant was sentenced to the following:

HUBER:  10 days, w/Standard Release Conditions and work/treatment.   Defendant to report to Huber facility by noon today. 

FINE: $1229.00 (to be paid at the rate of $100/month commencing 08/01/2016 or serve 29 days jail, consecutive, as penalty for non payment of fine);

DNA SURCHARGE:  $200.00, to be paid at $100/month consecutive to payment of fine or to be converted to a civil judgment for non payment of surcharge.

Defendant to provide DNA sample, if not yet provided,   immediately if in custody otherwise within (3) business days at the Waukesha County Sheriff Department.

BLOOD DRAW FEE:  $35.00 paid through Waukesha County Circuit Court to be forward to City of New Berlin Police Department or to be converted to a civil judgment for non payment of fee.
 
D/L REVOCATION: 24 months;

IGNITION INTERLOCK: 24 months;

Other:  AODA ASSESSMENT AND FOLLOW THROUGH.
